-- Link a new zone to children zones
-- canton and district
INSERT INTO geo_zone_parent (parent_id, child_id)
SELECT nr.id, child.id
FROM geo_zone nr, geo_zone child
  INNER JOIN geo_zone_parent gzp ON gzp.child_id = child.id
  INNER JOIN geo_zone parent ON gzp.parent_id = parent.id AND parent.code = '69'
WHERE nr.code = '69D'
  AND child.`type` IN ('canton', 'district')
;
-- city_community
INSERT INTO geo_zone_parent (parent_id, child_id)
SELECT nr.id, child.id
FROM geo_zone nr, geo_zone child
  INNER JOIN geo_zone_parent gzp ON gzp.child_id = child.id
  INNER JOIN geo_zone parent ON gzp.parent_id = parent.id AND parent.code = '69'
WHERE nr.code = '69D'
  AND child.`type` = 'city_community' AND child.code != '200046977'
;
-- city
INSERT INTO geo_zone_parent (parent_id, child_id)
SELECT nr.id, child.id
FROM geo_zone nr,
(
     SELECT child.id
     FROM geo_zone child
              INNER JOIN geo_zone_parent gzp ON gzp.child_id = child.id
              INNER JOIN geo_zone parent ON gzp.parent_id = parent.id AND parent.code IN ('69', '200046977')
     WHERE child.`type` = 'city'
     GROUP BY child.id
     HAVING GROUP_CONCAT(parent.code SEPARATOR ',') = '69'
) AS child
WHERE nr.code = '69D'
;

